function Stadistics() {

    useEffect(()=>{
        const bringPokemonuser=async()=>{

            const id_user=JSON.stringify((localStorage.getItem("userInfo"))._id);
            try {
                const {data}= await axios.get(`http://localhost:9000/api/pokemon/${id_user}`)
                console.log(id_user);
            } catch (error) {
                console.log(error)
            }
        }
        bringPokemonuser();
    },[])


  return (
    <div className='row'>
      <h3>Your team is mostly "Type"</h3>
      <div className="card col12 col-md-4">
        <div className="card-body">
          <h5 className="card-title">Card title</h5>
          <h6 className="card-subtitle mb-2 text-muted">Card subtitle</h6>
          <p className="card-text">
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </p>
        </div>
      </div>
    </div>
  );
}

export default Stadistics
